css:
ink-terminal,
.ink-terminal {
  height: 100%;
  padding-left: 0.5em;
  background-color: #282c34;
  color: #abb2bf;
}
ink-terminal .terminal.xterm,
.ink-terminal .terminal.xterm {
  height: 100%;
}
ink-terminal .terminal.xterm .xterm-viewport,
.ink-terminal .terminal.xterm .xterm-viewport {
  background-color: #282c34 !important;
}
ink-terminal .search,
.ink-terminal .search {
  position: absolute;
  top: 0.5em;
  right: 1em;
  background-color: #21252b;
  width: 30em;
  padding: 0.5em;
  z-index: 5;
  transition: border-color 0.2s;
  border: 2px #181a1f solid;
  border-radius: 2px;
}
ink-terminal .search .inputs,
.ink-terminal .search .inputs {
  flex-direction: row;
  display: flex;
}
ink-terminal .search .inputs > *,
.ink-terminal .search .inputs > * {
  padding-left: 0.5em;
  margin: auto;
}
ink-terminal .search .inputs .searchinput,
.ink-terminal .search .inputs .searchinput {
  flex: 1;
  padding-left: 0;
}
ink-terminal .search .errormessage,
.ink-terminal .search .errormessage {
  color: #ff6347;
  margin-top: 0.5em;
}
ink-terminal .search.nothingfound,
.ink-terminal .search.nothingfound {
  border-color: #d13b2e;
}
.scrollbars-visible-always ink-terminal ::-webkit-scrollbar-thumb {
  border-color: #282c34;
}
.scrollbars-visible-always ink-terminal ::-webkit-scrollbar-track {
  background-color: #282c34;
}
